  true,\n\t\"url\": null,\n\t\"notes\": \"nThe Particle Environment Monitor (PEM)
  level 2 Vector Magnetometer (VMAG) AC daily product contains the Vector Magnetic
  Field AC component.  PEM was flown on the UARS spacecraft to measure the type, amount,
  energy, and distribution of charged particles injected into the Earth's thermosphere,
  mesosphere, and stratosphere.nnThe VMAG DC magnetic field measurements are limited
  to frequencies less than 2.5 Hz by an 18 db/octave antialiasing filter.  Higher
  frequencies are measured with a peak detector and are the Vector Magnetic Field
  AC component.  The AC value is derived from each vector field component where the
  sensor output is pass band filtered from 2.5 to 50 Hz.  The resultant signal is
  then half wave rectified and passed to an RC circuit with a time constant of 4.7
  s.  The voltage across the RC circuit is the peak detector output which therefore
  represents the peak positive amplitude of the 2.5-50 Hz filtered sensor output occurring
  during the previous 5 seconds; however, the peak detector is determined at a rate
  of about every second (the VMAG AC data has been adjusted for this time offset).
  \ The X and Z peak detectors have full scale of 1oo nT peak to peak (= 5 Volts)
  and the Y peak detector has a full scale of 10 nT peak to peak (= 5 Volts).  The
  analog 0 to 5 Volts peak detector outputs are sent directly to the PEM central electronics
  package where they are digitized into a 265 binary word.  This is the raw value
  in the data.  No in-flight calibration of the AC peak detection electronics is provided.
  The VMAG unit is located on the zenith boom of UARS.n                        nThere
  is one data file per day for the PEM VMAG AC product, and the temporal coverage
  is from Oct. 1, 1991 to Aug. 23, 2005. Spatial coverage for the VMAG AC product
  ranges between -57 and +57 deg latitude.  The VMAG AC data files are written in
  network binary format. For more information please review the PEM VMAG AC data format
  guide.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
